import { View, Text } from 'react-native';
import { collection, addDoc, Timestamp } from "firebase/firestore";
import { database } from '../../firebase';
import React, { useState } from 'react';

const InsertData = () => {
    for(let i = 1; i< 101; i++){
        addDoc(collection(database, 'Users'), {
            id: i,
            fullname: 'Nguyễn Văn ' + i,
            age: i,
            joinDate: Timestamp.now(),
            address: i + '/122, KP8, Phường TCH, Quận ' + i,
            roles: ['MEMBER'],
            sex: true,
            photoURL: 'https://res.cloudinary.com/dopzctbyo/image/upload/v1649587847/sample.jpg'
        });
    }
    return(
        <View>
            <Text>Insert data success.</Text>
            <Text>Close tab now and...</Text>
            <Text>You must never be back here again!</Text>
        </View>
    )
};
export default InsertData;
